import React from "react";
import "./OrderForm.css";
import PizzaForm from "./PizzaForm";
function OrderForm() {
  return (
    <header>
      <div className="header-ust">
        Teknolojik Yemekler
        <br />
        <nav>
          <ul>
            <a>Ana Sayfa - </a>
            <a>Seçenekler - </a>
            <a>Sipariş Oluştur</a>
          </ul>
        </nav>
      </div>
      <PizzaForm />
    </header>
  );
}

export default OrderForm;
